(9, 26, 'Nguyễn Minh Thắng', 'Chúng tôi là', 'whoweare', '<h1 style="margin: 18px 0px 12px; padding: 0px 6px; font-size: 22px; line-height: 29.119998931884766px; color: rgb(212, 46, 18);"><div class="grid-945-center" style="margin: 0px auto; padding: 0px; width: 945px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; font-size: 11px; line-height: normal;"><div class="mod-rtf" style="margin: 0px; padding: 0px; font-size: 12px; line-height: 18px;"><img alt="Mary Kay Ash is the founder of Mary Kay Cosmetics" src="http://www.marykay.com/en-US/PublishingImages/corporate/company-and-founder/mary-kay-founder-50th-anniversary-hero-2-207017.jpg" style="margin: 0px; padding: 0px;"></div></div><div class="mod-main-content" style="margin: 0px 0px 50px; padding: 0px; min-height: 254px; position: relative; page-break-before: avoid; color: rgb(102, 102, 102); font-family: Arial, sans-serif; font-size: 11px; line-height: normal;"><div class="bg-x-main-content-gradient" style="margin: 0px; padding: 0px; height: 200px; background-image: url(http://www.marykay.com/UI/Core/Images/CoreCorporate-bg-x/main-content-gradient.png); position: absolute; top: 0px; width: 1265px; z-index: -1; background-position: initial initial; background-repeat: repeat no-repeat;"></div><div class="bg-main-content-radius" style="margin: 0px 0px 0px -472px; padding: 0px; background-image: url(http://www.marykay.com/UI/Core/Images/CoreCorporate-bg/main-content-radius.png); width: 945px; height: 25px; position: absolute; top: 0px; left: 632.5px; z-index: -1; background-position: initial initial; background-repeat: no-repeat no-repeat;"></div><div class="grid-945-center" style="margin: 0px auto; padding: 50px 0px 0px; width: 945px; position: relative;"><div class="mod-rtf" style="margin: 0px; padding: 0px; font-size: 12px; line-height: 18px;"><div class="mod-layout-7-4 fn-line-align" style="margin: 0px 0px 40px; padding: 0px; font-size: 0px; position: relative; width: 945px;"><div class="s-l-col1" style="margin: 0px 65px 0px 0px; padding: 0px; font-size: 12px; vertical-align: top; display: inline-block; zoom: 1; position: relative; width: 560px;"><div style="margin: 0px; padding: 0px; text-align: justify;">&nbsp;</div><div class="s-rtf-intro" style="margin: 0px 0px 20px; padding: 0px; font-size: 16px; line-height: 22px; text-align: justify;"><p style="margin-bottom: 20px; padding: 0px; border: 0px;"><strong style="margin: 0px; padding: 0px;">Mary Kay Ash was an original.</strong>&nbsp;As an entrepreneur and a philanthropist, she started her business from a tiny store in Dallas, Texas, with five products and one big dream. That dream was to inspire women to transform their lives, and in doing so, help other women transform their lives – because One Woman Can™.</p><p style="margin-bottom: 20px; padding: 0px; border: 0px;">One Woman Can™ transform her life, become her most beautiful success and touch other lives.</p><p style="margin-bottom: 20px; padding: 0px; border: 0px;">Today, with more than&nbsp;3 million Independent Beauty Consultants, Mary Kay offers more than 200 premium products in more than 35 countries around the world. Through all the milestones, one constant has remained: innovation. For 50 years, Mary Kay has led the way in giving women what they crave: advanced skin care that delivers results; modern makeup in on-trend colors and advanced formulations; and fresh, unforgettable fragrances. Believing in the power and importance of social responsibility, Mary Kay has led the way in showing that beauty can enrich women’s lives – one woman at a time.</p></div></div></div></div></div></div></h1><h1 style="margin-top: 18px; margin-bottom: 12px; padding: 0px 6px; font-size: 22px; line-height: 29.119998931884766px; color: rgb(212, 46, 18);"><div style="margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, sans-serif; font-size: 11px; line-height: 14.559999465942383px;"><div class="par parsys parbase basecomponent" style="margin: 0px; padding: 0px;"><div class="parbase basecomponent columncontrol" style="margin: 0px -16px 0px 0px; padding: 0px; overflow: hidden;"></div></div></div></h1><h1 style="margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-family: Berthold; font-size: 48px; line-height: inherit; vertical-align: baseline; text-transform: uppercase; letter-spacing: -1px; color: rgb(255, 255, 255); background-color: rgb(0, 0, 0);"><div style="margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: verdana, sans-serif; font-size: 11px; letter-spacing: normal; line-height: 14.559999465942383px; text-transform: none;"><div class="par parsys parbase basecomponent" style="margin: 0px; padding: 0px;"><div class="parbase basecomponent columncontrol" style="margin: 0px -16px 0px 0px; padding: 0px; overflow: hidden;"></div></div></div></h1>', 1, '2014-03-06 11:04:53', '2014-03-06 12:46:56'),
