(12, 26, 'Nguyễn Minh Thắng', 'Sứ mệnh', 'vision', '<section id="block-views-homepage-banners-block" class="block block-views" style="padding-top: 0px; margin-bottom: 30px; color: rgb(35, 35, 35); font-family: gibsonregular, Helvetica, Arial, sans-serif;"><div class="view view-homepage-banners view-id-homepage_banners view-display-id-block g3dhomebanner view-dom-id-06df927bb9da7a16832519d93a20f87f" style="position: relative;"><div class="view-content"><div class="skin-default"><div id="views_slideshow_cycle_main_homepage_banners-block" class="views_slideshow_cycle_main views_slideshow_main viewsSlideshowCycle-processed" style="height: 372px;"><div id="views_slideshow_cycle_teaser_section_homepage_banners-block" class="views-slideshow-cycle-main-frame views_slideshow_cycle_teaser_section" style="height: auto; width: 770px;"><div id="views_slideshow_cycle_div_homepage_banners-block_0" class="views-slideshow-cycle-main-frame-row views_slideshow_cycle_slide views_slideshow_slide views-row-1 views-row-odd" style="height: 372px !important; width: 770px; overflow: hidden;"><div class="views-slideshow-cycle-main-frame-row-item views-row views-row-0 views-row-first views-row-odd"><div class="views-field views-field-field-banner-image"><div class="field-content" style="max-width: 100%; width: 770px;"><img typeof="foaf:Image" src="http://www.newlookgroup.com/sites/default/files/homebanners/089_wk42_core_ad_seattle_gr.png" width="770" height="372" alt="" style="height: auto; max-width: 100%; width: 770px; margin: 0px; padding: 0px;"></div></div></div></div></div></div></div></div></div></section><article id="node-1462" class="node node-page clearfix" about="/who-we-are" typeof="foaf:Document" style="font-size: 16px; line-height: 24px; color: rgb(125, 125, 125); margin: 0px; padding: 0px; font-family: gibsonregular, Helvetica, Arial, sans-serif;"><div class="wrapperarticle"><header><h1 property="dc:title" datatype="" style="margin-top: 0px; margin-bottom: 25px; font-family: egizioitalic; line-height: 40px; color: rgb(0, 0, 0); text-rendering: optimizelegibility; font-size: 50px;">Who we are</h1></header><div class="field field-name-body field-type-text-with-summary field-label-hidden" style="margin: 0px; color: rgb(99, 99, 99); font-family: gibsonlight;"><div class="field-items"><div class="field-item even" property="content:encoded"><h2 style="margin: 0px 0px 20px; font-family: egizioitalic; line-height: 30px; color: rgb(0, 0, 0); text-rendering: optimizelegibility; border-bottom-width: 2px; border-bottom-style: dotted; border-bottom-color: rgb(0, 0, 0); padding-bottom: 20px;">New Look</h2><p>New Look is a leading fast fashion retailer, offering excitement and accessible fashion across the globe, New Look is always there to help the customer look and feel great.</p><p>Since opening our first shop in Taunton back in 1969, we’ve grown into a global brand, with:&nbsp;<br>•&nbsp;&nbsp; &nbsp;1,150+&nbsp;stores worldwide (and an online store serving over 120 countries)<br>•&nbsp;&nbsp; &nbsp;18,000 passionate people behind the scenes<br>•&nbsp;&nbsp; &nbsp;2.8+ million Facebook fans<br>•&nbsp;&nbsp; &nbsp;152+&nbsp;thousand Twitter followers.</p><p>Our mission is simple: to help our customers look and feel great. &nbsp;</p></div></div></div></div></article><section id="block-block-15" class="block block-block" style="padding-top: 0px; float: left; margin-right: 30px; margin-top: 30px; width: 370px; color: rgb(35, 35, 35); font-family: gibsonregular, Helvetica, Arial, sans-serif;"><div class="wrapperblock"><h3 style="margin-top: 0px; margin-right: 0px; margin-left: 0px; font-family: egizioitalic; line-height: 28px; color: rgb(99, 99, 99); text-rendering: optimizelegibility; font-size: 22px;"><img alt="" src="http://www.newlookgroup.com/sites/default/files/attachments/172_wk42_mens_el_tshirt_01.png" style="height: 143px; max-width: 100%; width: 370px;"></h3><h3 style="margin-top: 0px; margin-right: 0px; margin-left: 0px; font-family: egizioitalic; line-height: 28px; color: rgb(99, 99, 99); text-rendering: optimizelegibility; font-size: 22px;">Our History</h3><p>From our humble beginnings in Taunton in 1969, we''ve had an incredible journey.</p><p><a class="button" href="http://www.newlookgroup.com/about-us/our-history" style="color: rgb(255, 255, 255); background-image: none; background-attachment: scroll; background-color: rgb(0, 0, 0); border: 0px none; font-family: gibsonregular; font-size: 12px; height: 32px; padding: 5px 20px; text-transform: uppercase; background-position: 0px 0px; background-repeat: repeat repeat;">READ MORE</a></p></div></section><section id="block-block-16" class="block block-block" style="padding-top: 0px; float: left; margin-right: 0px; margin-top: 30px; width: 370px; color: rgb(35, 35, 35); font-family: gibsonregular, Helvetica, Arial, sans-serif;"><div class="wrapperblock"><h3 style="margin-top: 0px; margin-right: 0px; margin-left: 0px; font-family: egizioitalic; line-height: 28px; color: rgb(99, 99, 99); text-rendering: optimizelegibility; font-size: 22px;"><img alt="" src="http://www.newlookgroup.com/sites/default/files/medialibrary/images/ourpeople.jpg" style="height: auto; max-width: 100%; width: 370px;"></h3><h3 style="margin-top: 0px; margin-right: 0px; margin-left: 0px; font-family: egizioitalic; line-height: 28px; color: rgb(99, 99, 99); text-rendering: optimizelegibility; font-size: 22px;">Our People</h3><p>We''ve got personality in spades, and it shows in everything we do.</p><p><a class="button" href="http://www.newlookgroup.com/node/1378" style="color: rgb(255, 255, 255); background-image: none; background-attachment: scroll; background-color: rgb(0, 0, 0); border: 0px none; font-family: gibsonregular; font-size: 12px; height: 32px; padding: 5px 20px; text-transform: uppercase; background-position: 0px 0px; background-repeat: repeat repeat;">READ MORE</a></p></div></section>', 1, '2014-03-06 13:55:39', '2014-03-06 14:42:58'),
