(14, 26, 'Nguyễn Minh Thắng', 'Văn hóa', 'culture', '<div class="grid-945-center" style="margin: 0px auto; padding: 0px; width: 945px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; font-size: 11px; line-height: normal;"><div class="mod-rtf" style="margin: 0px; padding: 0px; font-size: 12px; line-height: 18px;"><div class="mod-layout-page-header fn-clearfix" style="margin: 0px; padding: 0px; position: relative;"><h1 style="margin-bottom: 15px; padding: 60px 0px 40px; font-size: 50px; border: 0px; font-family: Arial, sans-serif; color: rgb(51, 51, 51); line-height: 46px; letter-spacing: 1px; page-break-after: avoid; text-transform: uppercase;">A COMMITMENT TO ENDING&nbsp;&nbsp;&nbsp;&nbsp;<br style="margin: 0px; padding: 0px;"><span style="margin: 0px; padding: 0px; font-weight: 800;">DOMESTIC VIOLENCE</span><span style="margin: 0px; padding: 0px; font-size: 16px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span></h1><img src="http://www.marykay.com/en-US/PublishingImages/corporate/dontlookaway/mary-kay-dont-look-away-logo.jpg" alt="" style="margin: 0px; padding: 0px; position: absolute; right: 0px; bottom: 40px;"></div></div></div><div class="mod-main-content" style="margin: 0px 0px 50px; padding: 0px; min-height: 254px; position: relative; page-break-before: avoid; color: rgb(102, 102, 102); font-family: Arial, sans-serif; font-size: 11px; line-height: normal;"><div class="bg-x-main-content-gradient" style="margin: 0px; padding: 0px; height: 200px; background-image: url(http://www.marykay.com/UI/Core/Images/CoreCorporate-bg-x/main-content-gradient.png); position: absolute; top: 0px; width: 1265px; z-index: -1; background-position: initial initial; background-repeat: repeat no-repeat;"></div><div class="bg-main-content-radius" style="margin: 0px 0px 0px -472px; padding: 0px; background-image: url(http://www.marykay.com/UI/Core/Images/CoreCorporate-bg/main-content-radius.png); width: 945px; height: 25px; position: absolute; top: 0px; left: 632.5px; z-index: -1; background-position: initial initial; background-repeat: no-repeat no-repeat;"></div><div class="grid-945-center" style="margin: 0px auto; padding: 50px 0px 0px; width: 945px; position: relative;"><div class="mod-rtf" style="margin: 0px; padding: 0px; font-size: 12px; line-height: 18px;"><h2 style="margin: 0px auto 30px; padding: 0px 0px 4px; font-size: 24px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(225, 224, 224); line-height: 27px; clear: both; font-family: Arial, sans-serif; text-transform: uppercase; color: rgb(34, 34, 34); max-width: 945px; page-break-after: avoid;">MARY KAY TRUTH ABOUT ABUSE SURVEY</h2><div class="s-rtf-intro" style="margin: 0px 0px 20px; padding: 0px; font-size: 16px; line-height: 22px; text-align: justify;">Mary Kay and The Mary Kay Foundation<span style="margin: 0px; padding: 0px; font-size: 11px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;">SM</span><span style="margin: 0px; padding: 0px; font-size: 11px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 11px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 11px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span>&nbsp;partner each year to survey domestic violence shelters to learn more about what is happening on the front lines of this important issue. The annual survey takes an in-depth look at domestic violence through the perspective of executive directors at women’s shelters across the country.</div><div class="mod-layout-7-4 fn-line-align" style="margin: 0px 0px 40px; padding: 0px; font-size: 0px; position: relative; width: 945px;"><div class="s-l-col1" style="margin: 0px 65px 0px 0px; padding: 0px; font-size: 12px; vertical-align: top; display: inline-block; zoom: 1; position: relative; width: 560px; text-align: justify;"><p style="padding: 0px; border: 0px;">Young women who were in shelters as children are now seeking protection from domestic violence situations themselves according to the&nbsp;<a href="http://ecatalog.marykay.com/us_en-us/GetLatest.aspx?d=www.marykay.com&amp;m=0&amp;t=Truth_About_Abuse_Survey" target="_blank" style="margin: 0px; padding: 0px; color: rgb(178, 93, 100);">2013 Mary Kay Truth About Abuse Survey</a>. The survey also reported that many women are staying in shelters for longer periods of time because of limited access to resources which unfortunately prevents other women from receiving needed assistance. As fewer women are able to seek shelter, more women are staying in or going back to violent and dangerous situations.</p><div style="margin: 0px; padding: 0px;">More than 800 women’s shelters across the nation were surveyed. Mary Kay learned:</div><ul style="margin: 10px 0px 5px; padding: 0px; list-style-type: none; list-style-position: outside;"><li style="margin: 0px 0px 0px 18px; padding: 5px 0px; list-style-type: disc; list-style-position: outside;">Most shelters are servicing more women, specifically more women between the ages of 18-32 and more women with children.</li><li style="margin: 0px 0px 0px 18px; padding: 5px 0px; list-style-type: disc; list-style-position: outside;"><strong style="margin: 0px; padding: 0px;"></strong>The shelters who said they are serving fewer women say it is because residents are staying longer due to limited resources and the economy.</li><li style="margin: 0px 0px 0px 18px; padding: 5px 0px; list-style-type: disc; list-style-position: outside;"><strong style="margin: 0px; padding: 0px;"></strong>The economy continues to be a factor for clients. However, the economy is not the reason for the abuse. The economy is why women stay or go back to their abusers.</li><li style="margin: 0px 0px 0px 18px; padding: 5px 0px; list-style-type: disc; list-style-position: outside;"><strong style="margin: 0px; padding: 0px;"></strong>Mental health issues are prevalent.</li><li style="margin: 0px 0px 0px 18px; padding: 5px 0px; list-style-type: disc; list-style-position: outside;">While many shelters are able to provide emergency housing, most do not have the resources to provide the long-term care and rehabilitation that survivors need to ultimately break the cycle.</li></ul></div>&nbsp;<div class="s-l-col2" style="margin: 0px; padding: 0px; font-size: 12px; vertical-align: top; display: inline-block; zoom: 1; position: relative; width: 320px;"><a href="http://www.marykay.com/en-US/PublishingImages/corporate/social-responsibility/mary-kay-truth-about-abuse-2013-infographic.jpg" target="_blank" style="margin: 0px; padding: 0px; color: rgb(178, 93, 100);"><img alt="See the shocking numbers on domestic violence. " src="http://www.marykay.com/en-US/PublishingImages/corporate/social-responsibility/mary-kay-truth-about-abuse-2013-infographic-tn.jpg" style="margin: 0px; padding: 0px;"></a>&nbsp;&nbsp;</div></div><h2 style="margin: 0px auto 30px; padding: 0px 0px 4px; font-size: 24px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(225, 224, 224); line-height: 27px; clear: both; font-family: Arial, sans-serif; text-transform: uppercase; color: rgb(34, 34, 34); max-width: 945px; page-break-after: avoid;"><span lang="EN" style="margin: 0px; padding: 0px;"><div style="margin: 0px; padding: 0px;">MARY KAY PROVIDES SUPPORT</div></span></h2><div class="s-rtf-intro" style="margin: 0px 0px 20px; padding: 0px; font-size: 16px; line-height: 22px; text-align: justify;"><span lang="EN" style="margin: 0px; padding: 0px;">In the United States, Mary Kay is committed to changing the lives of women and children by helping to end and prevent domestic violence.<a href="http://ecatalog.marykay.com/us_en-us/GetLatest.aspx?d=www.marykay.com&amp;m=0&amp;t=CSR_Report" target="_blank" style="margin: 0px; padding: 0px; color: rgb(178, 93, 100);">Click here</a>&nbsp;to view the CSR Report.</span></div><div class="mod-layout-7-4 fn-line-align" style="margin: 0px 0px 40px; padding: 0px; font-size: 0px; position: relative; width: 945px;"><div class="s-l-col1" style="margin: 0px 65px 0px 0px; padding: 0px; font-size: 12px; vertical-align: top; display: inline-block; zoom: 1; position: relative; width: 560px; text-align: justify;"><h3 class="ms-rteElement-H3" style="margin: 0px auto 8px; padding: 0px; font-size: 14px; border: 0px; line-height: 18px; clear: both; font-family: Arial, sans-serif; color: rgb(34, 34, 34); text-transform: uppercase; max-width: 945px; page-break-after: avoid;"><em style="margin: 0px; padding: 0px;">BEAUTY THAT COUNTS</em>®</h3><p style="padding: 0px; border: 0px;">Thanks to you, Mary Kay&nbsp;has donated millions of dollars&nbsp;USD to causes that change the lives of women and children around the world.&nbsp; The funds for these donations came from the worldwide sale of&nbsp;<em style="margin: 0px; padding: 0px;">Beauty That Counts</em>®&nbsp;<em style="margin: 0px; padding: 0px;">Mary Kay</em>® products since 2008.&nbsp; These donations are giving survivors of domestic violence a chance to heal, cancer sufferers a hope for tomorrow and orphaned children a reason to smile.</p><p style="padding: 0px; border: 0px;">As part of this effort in the United States, Mary Kay Inc. is proud to support&nbsp;&nbsp;<a href="http://www.marykayfoundation.org/" style="margin: 0px; padding: 0px; color: rgb(178, 93, 100);">The Mary Kay&nbsp;</a><span style="margin: 0px; padding: 0px;"><span style="margin: 0px; padding: 0px;"></span></span><span style="margin: 0px; padding: 0px;">Foundation</span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;">SM</span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span>in its efforts to end domestic violence.</p><p style="padding: 0px; border: 0px;"><a href="http://www.marykay.com/en-US/About-Mary-Kay/SocialResponsibility/Pages/Thank-You-For-Making-A-Difference.aspx" target="_blank" style="margin: 0px; padding: 0px; color: rgb(178, 93, 100);"><span style="margin: 0px; padding: 0px; font-weight: bold;">Learn more</span></a></p><p style="padding: 0px; border: 0px;">&nbsp;</p><h3 class="ms-rteElement-H3" style="margin: 12px auto 8px; padding: 0px; font-size: 14px; border: 0px; line-height: 18px; clear: both; font-family: Arial, sans-serif; color: rgb(34, 34, 34); text-transform: uppercase; max-width: 945px; page-break-after: avoid;">NATURE EXPLORE CLASSROOMS</h3><p style="padding: 0px; border: 0px;">Mary Kay Inc. and The Mary Kay Foundation<span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;">SM</span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span>&nbsp;have built 13 Nature Explore Classrooms at women’s shelters across the country and will fund four more in 2012.&nbsp; The Nature Explore Classrooms are the first of their kind to be built at domestic violence shelters.&nbsp; The classrooms provide outdoor learning spaces where the power of nature can help children learn, play and heal from abuse.</p><a class="js-bind-to-popup" href="http://www.marykay.com/en-US/About-Mary-Kay/SocialResponsibility/Pages/pop-up%20overlay%20video/Nature_Explores_Classrooms_Video.aspx" style="margin: 0px; padding: 0px; color: rgb(178, 93, 100);"><span style="margin: 0px; padding: 0px; font-weight: bold;">Watch the Video</span></a><br style="margin: 0px; padding: 0px;"><br style="margin: 0px; padding: 0px;"><h3 class="ms-rteElement-H3" style="margin: 12px auto 8px; padding: 0px; font-size: 14px; border: 0px; line-height: 18px; clear: both; font-family: Arial, sans-serif; color: rgb(34, 34, 34); text-transform: uppercase; max-width: 945px; page-break-after: avoid;">SHELTER GRANTS</h3><p style="padding: 0px; border: 0px;">The Mary Kay Foundation<span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;">SM</span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span>&nbsp;awards $3 million in shelter grants to 150 domestic violence shelters nationwide each year.&nbsp; Each shelter receives a $20,000 grant to help combat domestic violence, educate local communities and provide much needed shelter and rehabilitation services.&nbsp; By the end of 2012, The Mary Kay Foundation<span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;">SM</span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span>&nbsp; will have&nbsp;donated more than $31 million to domestic violence organizations nationwide.</p><p style="padding: 0px; border: 0px;"><a href="http://www.marykayfoundation.org/Pages/Home.aspx" target="_blank" style="margin: 0px; padding: 0px; color: rgb(178, 93, 100);"><span style="margin: 0px; padding: 0px; font-weight: bold;">Learn more about The Mary Kay Foundation<span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;">SM</span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span><span style="margin: 0px; padding: 0px; font-size: 8px; height: 0px; line-height: 1; vertical-align: baseline; position: relative; bottom: 1ex;"></span></span></a></p><p style="padding: 0px; border: 0px;">&nbsp;</p><h3 class="ms-rteElement-H3" style="margin: 12px auto 8px; padding: 0px; font-size: 14px; border: 0px; line-height: 18px; clear: both; font-family: Arial, sans-serif; color: rgb(34, 34, 34); text-transform: uppercase; max-width: 945px; page-break-after: avoid;">LOBBYING FOR GOOD</h3><p style="padding: 0px; border: 0px;">Mary Kay and members of the independent sales force are lobbying legislators to help prevent and end domestic violence. Since the 1980s, Mary Kay Inc. and members of its independent sales force have lobbied Congress and state legislatures on issues including the Violence Against Women Act and, most recently, teen dating violence awareness and prevention. Mary Kay and members of the Mary Kay independent sales force have lobbied state lawmakers in California, Georgia, Texas, Massachusetts, Tennessee, Pennsylvania&nbsp;and members of Congress in Washington, D.C.</p><a class="js-bind-to-popup" href="http://www.marykay.com/en-US/About-Mary-Kay/SocialResponsibility/Pages/pop-up%20overlay%20video/Lobbying-For-Good-Video.aspx" style="margin: 0px; padding: 0px; color: rgb(178, 93, 100);"><span style="margin: 0px; padding: 0px; font-weight: bold;">Watch the Video</span></a><p style="padding: 0px; border: 0px;">&nbsp;</p><h3 class="ms-rteElement-H3" style="margin: 12px auto 8px; padding: 0px; font-size: 14px; border: 0px; line-height: 18px; clear: both; font-family: Arial, sans-serif; color: rgb(34, 34, 34); text-transform: uppercase; max-width: 945px; page-break-after: avoid;">BREAK THE CYCLE DVD</h3><p style="padding: 0px; border: 0px;">With one in three teens being the victim of physical, sexual, verbal or emotional abuse in a relationship,** Mary Kay Inc. partnered with the national nonprofit organization Break the Cycle to sponsor its interactive "Ending Violence" DVD. This comprehensive DVD was made available to schools nationwide in February 2010 as part of the first-ever Teen Dating Violence Awareness Month. This preventive education curriculum teaches teens about healthy relationships.</p><p style="padding: 0px; border: 0px;">For more information, please visit&nbsp;<a href="http://www.breakthecycle.org/" target="_blank" style="margin: 0px; padding: 0px; color: rgb(178, 93, 100);">www.breakthecycle.org</a>.</p><blockquote class="s-rtf-footnote" style="margin-top: 60px; margin-bottom: 0px; padding: 0px; font-size: 11px; line-height: 15px;"><p style="padding: 0px; font-size: 11px; border: 0px; line-height: 13px;">**According to Break the Cycle</p></blockquote></div>&nbsp;<div class="s-l-col2" style="margin: 0px; padding: 0px; font-size: 12px; vertical-align: top; display: inline-block; zoom: 1; position: relative; width: 320px;"><img alt="Discover how The Mary Kay FoundationSM  is helping to provide outdoor learning spaces at women’s shelters to help abused children heal" src="http://www.marykay.com/en-US/PublishingImages/corporate/social-responsibility/mary-kay-social-responsibility-local-initiatives-image-2.jpg" style="margin: 0px; padding: 0px; max-width: 320px;"><img alt="Learn about Mary Kay’s efforts to bring about legislation to help prevent and end domestic violence." src="http://www.marykay.com/en-US/PublishingImages/corporate/social-responsibility/mary-kay-social-responsibility-local-initiatives-image-3.jpg" style="margin: 30px 0px; padding: 0px; max-width: 320px;"></div></div></div></div></div>', 1, '2014-03-06 14:42:09', '2014-03-06 14:42:09');
